import React, { Component } from 'react';

class MovieCard extends Component {
  render() {
    console.log(this.props.card);
    const { series } = this.props;
    return (
      <section>
      <h2>{series.name}</h2>
      <p>{series.genre}</p>
      <img
        src={series.image} alt="Supernatural" />
      <h3>
        <ul>
          <li>Sam</li>
          <li>Dean</li>
        </ul>
      </h3>
    </section>
    );
  }
}

export default MovieCard;
